bookDetail.JSParser:
function functionName(config, params, result)
{
      let reg = /"speaker_name":"(.*?)"/gim;
	let bookInfo = params.queryInfo;
      bookInfo.bookName = params.queryInfo.bookName;
      bookInfo.author = reg.exec(result)[1];
	return {'response':bookInfo, 'removeHtmlKeys':'desc'};

      return undefined;
}

chapterList.JSParser:
function functionName(config, params, result)
{
	let list = [];

	let chapterInfo = {};
	chapterInfo.title = params.queryInfo.bookName;
	chapterInfo.url = params.queryInfo.detailUrl;
	list.push(chapterInfo);

	return {'list':list};
}

chapterContent.JSParser:
function functionName(config, params, result)
{

	let reg = /"stream":"(.*?)"/gim;

      if(res = reg.exec(result)){
            //return res[1];
            let re = res[1].replace(/\\/g, '');
            return {'response':re, 'removeHtmlKeys':'response'};
      }
	return undefined;

}
